// src/components/Banner.jsx
import React from 'react';

const Banner = () => {
  return (
    <>
      <div>
        <h2>SOFTWARE DEVELOPER</h2>
        <h1>VIKHAN MUHARRAM</h1>
        <h3>Turning ideas into real-world apps</h3>
      </div>

      <div>
        <img src="/assets/images/profile.jpg" alt="Vikhan Muharram" className="w-64 h-40" />
      </div>
    </>
  );
};

export default Banner;
